import React, {useState} from "react";

const FullRecord = (rec) => {
    return (
        <div style={{border: '1px solid rgba(0, 0, 100, 0.5)', margin: '10px', width: '600px'}}>
            <strong>Имя: </strong> {rec.full_name}, <strong>телефон:</strong> {rec.phone}, <strong>email: </strong> {rec.email} <br />
            <strong>Город: </strong> {rec.city}, <strong>улица:</strong> {rec.street}, <strong>дом:</strong> {rec.house}, 
            <strong>подъезд:</strong> {rec.entrance}, <strong>этаж:</strong> {rec.floor}, <strong>домофон:</strong> {rec.City}
        </div>
    );
};

export default FullRecord;
